sys_variable_value.value:
(function execute(inputs, outputs) {

   try { 
     var r = new sn_ws.RESTMessageV2('x_78983_data_dicti.SN DataDictionary', 'ChangeSourceUpdateSetState');
     r.setStringParameterNoEscape('source_instance', inputs.source_instance_name);

     // For testing purposes only, to be deleted
     var overrideEndpoint = "https://" + inputs.source_instance_name + ".service-now.com/api/cscm4/data_dictionary/change_update_set_state";
     r.setEndpoint(overrideEndpoint);

     var bodyJson = {
        "update_set_sys_id": inputs.update_set_sys_id,
        "new_state": inputs.new_state
     };
     r.setRequestBody(JSON.stringify(bodyJson));

     //override authentication profile 
     //authentication type ='basic'/ 'oauth2'
     //r.setAuthenticationProfile(authentication type, profile name);

     //set a MID server name if one wants to run the message on MID
     //r.setMIDServer('MY_MID_SERVER');

     //if the message is configured to communicate through ECC queue, either
     //by setting a MID server or calling executeAsync, one needs to set skip_sensor
     //to true. Otherwise, one may get an intermittent error that the response body is null
     //r.setEccParameter('skip_sensor', true);

     var response = r.execute();
     var responseBody = response.getBody();
     var httpStatus = response.getStatusCode();

     var responseJson = JSON.parse(response.getBody()).result;

     //gs.info("responseJson: " + JSON.stringify(responseJson));

     if (responseJson.confirmed)
       outputs.closure_confirmed = true;
  }
  catch(ex) {
   var message = ex.message;
  }

})(inputs, outputs);

